                        'bbcode',
                        'c',
                        'c++',
                        'cpp',
                        'coffee',
                        'csharp',
                        'css',
                        'dart',
                        'django',
                        'ejs',
                        'erlang',
                        'golang',
                        'handlebars',
                        'haskell',
                        'haxe',
                        'html',
                        'ini',
                        'jade',
                        'java',
                        'javascript',
                        'json',
                        'less',
                        'lisp',
                        'lua',
                        'makefile',
                        'markdown',
                        'matlab',
                        'mysql',
                        'objectivec',
                        'pascal',
                        'perl',
                        'pgsql',
                        'php',
                        'python',
                        'r',
                        'ruby',
                        'sass',
                        'scala',
                        'scss',
                        'smarty',
                        'sql',
